--
-- Table structure for table `province`
--

DROP TABLE IF EXISTS `province`;

CREATE TABLE `province` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `name` varchar(8) COLLATE utf8_unicode_ci NOT NULL COMMENT '行政区名称（不含单位）',
  `suffix` varchar(8) COLLATE utf8_unicode_ci NOT NULL COMMENT '行政单位',
  `fullname` varchar(16) COLLATE utf8_unicode_ci NOT NULL COMMENT '全名',
  `code` char(2) COLLATE utf8_unicode_ci NOT NULL COMMENT '省级行政区划代码 See  http://www.stats.gov.cn/tjsj/tjbz/xzqhdm/201504/t20150415_712722.html',
  `domain` char(2) COLLATE utf8_unicode_ci NOT NULL COMMENT '中国互联网络域名体系 See http://www.gov.cn/gzdt/2006-02/24/content_210497_2.htm',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='省/直辖市/自治区/特别行政区';

