--
-- Table structure for table `cn_county`
--

DROP TABLE IF EXISTS `cn_county`;

CREATE TABLE `cn_county` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `name` varchar(8) COLLATE utf8_unicode_ci NOT NULL COMMENT '行政区名称（不含单位）',
  `suffix` varchar(16) COLLATE utf8_unicode_ci NOT NULL COMMENT '行政单位',
  `fullname` varchar(16) COLLATE utf8_unicode_ci NOT NULL COMMENT '全名',
  `code` char(6) COLLATE utf8_unicode_ci NOT NULL COMMENT '县级行政区划代码 See  http://www.stats.gov.cn/tjsj/tjbz/xzqhdm/201504/t20150415_712722.html',
  `pcode` char(4) COLLATE utf8_unicode_ci NOT NULL COMMENT '所在cn_city的code',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3134 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='县/区';

